import React from "react";

const MovieCard = (props) => {
    return(
        <div className="movie">
          <div>
            <p>{props.movie1.Year}</p>
          </div>
          <div>
            <img 
            src={props.movie1.Poster !== 'N/A' ? props.movie1.Poster : 'https://via.placeholder.com/400'} alt={props.movie1.Title}
            />
          </div>
          <div>
            <span>{props.movie1.Type}</span>
            <span>{props.movie1.Title}</span>
          </div>
        </div>
    );
}

export default MovieCard;
